const DashboardContainer = styled.main`
  width: 100vw;
  height: 100vh;
  display: flex;
  flex-direction: column;
  background-image: url("https://firebasestorage.googleapis.com/v0/b/zeitgeist-23.appspot.com/o/Resources%2FCA%2Fbackgrounds%2FdashboardBg.png?alt=media&token=998804bb-840a-4190-a5e3-9320903809c0");
  overflow: hidden;
  nav {
    display: flex;
    width: 80vw;
    justify-content: space-between;
    align-items: center;
    margin: 0 auto;
    padding-top: 15px;
    min-width: fit-content;
    gap: 20px;
    .nav-logo-wrapper {
      position: relative;
      width: 10vw;
      aspect-ratio: 1/1;
      max-width: 185px;
      min-width: 100px;
      > img {
        position: absolute;
        top: 0;
        right: 0;
        left: 0;
        bottom: 0;
      }
      .nav-logo {
        position: absolute;
        width: 100%;
        height: 100%;
        left: 50%;
        top: 50%;
        translate: -50% -50%;
        background-image: url("https://firebasestorage.googleapis.com/v0/b/zeitgeist-23.appspot.com/o/Resources%2FCA%2Fresources%2FnavLogo.svg?alt=media&token=b356b6ff-9085-4423-9d09-e1ebc4aeca71");
        background-size: contain;
        background-position: center;
        background-repeat: no-repeat;

        display: flex;
        align-items: center;
        justify-content: center;
        > svg {
          width: 80%;
          margin-top: 5%;
        }
      }
    }
    .buttons {
      display: flex;
      gap: 20px;
    }
  }
  section {
    position: relative;
    width: 80vw;
    height: 70vh;
    margin: 0 auto;
    display: grid;
    grid-template-rows: 13% 85%;
    row-gap: 2%;
    grid-template-columns: 35% 60%;
    column-gap: 5%;
    margin-bottom: min(15vw, 15vh);
    flex: 1;
    @media screen and (max-width: 820px) {
      grid-template-columns: 1fr;
      gap: 0;
      margin: auto;
    }
    .personal-details {
      > div {
        background-image: url("https://firebasestorage.googleapis.com/v0/b/zeitgeist-23.appspot.com/o/Resources%2FCA%2Fresources%2FPersonalDetailsBg.png?alt=media&token=0e38ff6b-da6c-4cf7-8a93-752643729dfc");
        background-blend-mode: overlay;
      }
      z-index: 1;
      grid-row-start: 2;
      @media screen and (max-width: 820px) {
        display: none;
      }
    }
    .switch-buttons {
      grid-column-start: 2;
      @media screen and (max-width: 820px) {
        grid-column-start: 1;
      }
      display: flex;
      align-items: center;
      gap: 4px;
      justify-content: space-around;
      > button:first-child {
        display: none;
        @media screen and (max-width: 820px) {
          display: initial;
        }
      }
    }
    .other-details {
      z-index: 1;
      grid-row-start: 2;
      grid-column-start: 2;
      @media screen and (max-width: 820px) {
        grid-column-start: 1;
      }
      > div {
        background-image: url("https://firebasestorage.googleapis.com/v0/b/zeitgeist-23.appspot.com/o/Resources%2FCA%2Fresources%2FPersonalDetailsBg.png?alt=media&token=0e38ff6b-da6c-4cf7-8a93-752643729dfc");
        background-blend-mode: overlay;
      }
    }
    > img {
      @media screen and (max-width: 820px) {
        display: none;
      }
      width: 20vw;
      position: absolute;
      left: 0;
      bottom: 0;
      translate: -40% 40%;
      &:last-child {
        width: 10vw;
        left: 100%;
        top: 15%;
        translate: -60% -40%;
      }
    }
    color: var(--lightest, #f8f2d8);
    font-family: "Jost";
  }
`;
